import { useState, useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom'
import Nav from 'react-bootstrap/Nav'
import Card from 'react-bootstrap/Card'


const cases = require('../cases.json')

const GamePage = (props) => {
  const { cid, rid } = useParams()
  const [c, setC] = useState({})
  const [selected, setSelected] = useState("0")

  useEffect(() => {
    // const url = window.location.href.split("/")
    // setCaseID(url[url.length - 2])
    // setGameID(url[url.length - 2])
    console.log(cid)
    console.log(rid)

    setC(cases.filter(x => x.id === cid)[0])
    console.log(c)

  }, []);




  return (
    <div style={{margin:"0 auto", width:"80%", padding:"5%", textAlign:"left"}}>
      <Card>
        <Card.Header>
        <Nav variant="tabs" defaultActiveKey="0" onSelect={(key) => setSelected(key)}>
          <Nav.Item>
            <Nav.Link eventKey="0">Option 0</Nav.Link>
          </Nav.Item>

          <Nav.Item>
            <Nav.Link eventKey="1">Option 1</Nav.Link>
          </Nav.Item>

          <Nav.Item>
            <Nav.Link eventKey="2">Option 2</Nav.Link>
          </Nav.Item>

        </Nav>
        </Card.Header>

          <div style={{margin: "30px"}}>
            {
            c.name
            }

          </div>



        </Card>

    </div>
  )



}

export default GamePage
